import React from "react";
import { Row, Col } from "antd";
import Avatar1 from "../image/avatar1.jpg";
import Avatar2 from "../image/avatar2.jpg";

class Avatar extends React.Component {
  constructor(props) {
    super(props);
  }
  render() {
    return (
      <>
        <Row>
          <Col span={8}>
            <div>
              <img
                style={{
                  width: "70px",
                  height: "70px",
                  borderRadius: "50%",
                  objectFit: "cover",
                }}
                src={Avatar1}
              ></img>
            </div>
          </Col>
          <Col span={8}></Col>
          <Col span={8}>
            <div>
              <img
                style={{
                  width: "70px",
                  height: "70px",
                  borderRadius: "50%",
                  objectFit: "cover",
                }}
                src={Avatar2}
              ></img>
            </div>
          </Col>
        </Row>
      </>
    );
  }
}

export default Avatar;
